            }
            if ((printMask?.VertexColors ?? true)
                && item.VertexColors.TryGet(out var VertexColorsItem))
            {
                fg.AppendLine($"VertexColors => {SpanExt.ToHexString(VertexColorsItem)}");
            }
            if (printMask?.Layers?.Overall ?? true)
            {
                fg.AppendLine("Layers =>");
